package solved.easy.string.s_09_389_find_the_difference;

import org.junit.Test;

import static org.junit.Assert.assertEquals;

public class SolutionTest {

    Solution sut = new Solution();

    @Test
    public void test_1() {
        String s = "abcd";

        String t = "abcde";

        char actual = sut.findTheDifference(s, t);

        char expected = 'e';

        assertEquals(expected, actual);
    }


    @Test
    public void test_2() {
        String s = "";

        String t = "y";

        char actual = sut.findTheDifference(s, t);

        char expected = 'y';

        assertEquals(expected, actual);
    }

    @Test
    public void test_3(){
        String s = "";

        String t = "";

        char actual = sut.findTheDifference(s, t);

        char expected = 't';

        assertEquals(expected, actual);
    }
}

